import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';


function ExchangeC() {
    const accounts = [
        { label: 'Dolar' },
        { label: 'Tl' },
        { label: 'Altın' },
        { label: 'Euro' },
    ];
    return (
        <div className="container">
        <Stack spacing={2} sx={{ width: 300 }}></Stack>
            <Autocomplete
                disablePortal
                id="combo-box-demo"
                options={accounts}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Sold" />}
            />
            <Autocomplete
                disablePortal
                id="combo-box-demo"
                options={accounts}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Received" />}
            />
            <TextField id="standard-basic" label="Sold Amount" variant="standard" />
        </div>
    );
}
export default ExchangeC;
